import React from "react";
import { Route, BrowserRouter, Switch } from "react-router-dom";

import App from "./App";
import home from "./pages/home";

export default function Routes() {
   return(
       <BrowserRouter>
            <Switch>
                <Route component = { App }  path="/" exact/>
                <Route component = { home }  path="/home" />
            </Switch>
       </BrowserRouter>
   )
}
